Our Vision is to Be the Standard of Excellence! Our Mission is Value every Voice, remain Humanities focused, and Achieve Academic Excellence for All. As a CPS Magnet School our goals are to ensure students receive a high quality, enriched, theme-based curriculum to enable students to meet and exceed their academic potential.

