Hitch Elementary is a premiere neighborhood school that offers a holistic curriculum, incorporating classic academic subjects as well as arts and athletics education.  In addition to our school day courses, Hitch offers a wide variety of after school programs.  We are a Level 1+ school with Healthy Schools Certification, Excelling Arts certification, and a Gold Circle of Quality PreK program. 

We partner with local and national businesses and Universities to give students real life learning opportunities (e.g. Purdue University and the University of North Carolina).

